import PopularRestaurant from './popular-restaurants/PopularRestaurant';
import Chef from './chefs/Chef';
import './HomePage.scss';
import claro from '../../assets/claro.png';
import lumina from '../../assets/mizlala-gret-mullet-fillet.png';
import tiger from '../../assets/screen-shot-2019-01-06-at-10-57-26.png'; 
import SignatureDish from './signature-dishes/SignatureDishes';
import { Fragment } from 'react';

const DUMMY_DATA = [
    {
      id: 'm1',
      restaurantImage: claro,
      restaurantName: 'Claro',
      chef: 'Ran Shmueli',
      chefDescription: '',
      signatureName: '',
      signatureImage: '',
      signatureDescription: '',
      icon: '',
      price: ''
    },
    {
      id: 'm2',
      restaurantImage: lumina,
      name: 'Lumina',
      chef: 'Meir Adoni',
      chefDescription: '',
      signatureName: '',
      signatureImage: '',
      signatureDescription: '',
      icon: '',
      price: 25
    },
    {
      id: 'm3',
      restaurantImage: tiger,
      name: 'Tiger Lilly',
      chef: 'Yanir Green',
      chefDescription: '',
      signatureName: '',
      signatureImage: '',
      signatureDescription: '',
      icon: '',
      price: ''
    }
  ];


  const DummyData= () => {
      const popularList= DUMMY_DATA.map((restaurant) => (<PopularRestaurant key={restaurant.id} name={restaurant.name} chef={restaurant.chef} image={restaurant.restaurantImage} />));
      const signatureList= DUMMY_DATA.map((dish) => (<SignatureDish key={dish.id} signatureName={dish.signatureName} signatureImage={dish.signatureImage} signatureDescription={dish.signatureDescription} icon={dish.icon} price={dish.price} />));
      const chefList= DUMMY_DATA.map((chef) => (<Chef key={chef.id} chef={dish.name} image={dish.dishImage} signatureDescription={dish.signatureDescription} icon={dish.icon} price={dish.price} />));

      return(
        <Fragment>
          <div className='popular-container'>
             {popularList}
          </div>
          <div className='popular-container'>
            {signatureList}
          </div>
        </Fragment>

      )
  }

  export default DummyData;
